import Link from '../Components/Link';
import Question from '../Components/Question';
import { SUBMIT_PAGE_PATH, useFetchQuestionsQuery} from '../store';


function QuestionsExam()
{
    const qObjects = [
        {
            id: 14, 
            type:"multipleChoice", 
            question: "question 1", 
            alternatives: ["2", "11"],
            answer: "2"
        },
        {
            id: 15, 
            type:"descriptive", 
            question: "question 2", 
            alternatives: [],
            answer: "Around 3 lines of descriptive answer."
        }
    ]
    //const {data, error, isLoading} = useFetchQuestionsQuery();

    const questionsContent = qObjects.map((qObject) => 
    {
        return <div style={{paddingTop: 5}}>
            <Question key={qObject.id} data={qObject}/>
        </div>
    })

    return <div className="centerForm">
        <div className="centerScreen"> 
            <h3>Questions:</h3>
            {questionsContent}
            <div style={{paddingTop: 35}}>
                <Link to={SUBMIT_PAGE_PATH}>
                    <button style={{fontSize : `16px`}}>SUBMIT</button>
                </Link>
            </div>
        </div>
    </div>
}

export default QuestionsExam;
